import './App.css';
import Header from './Header';
import Home from './Home';


function App() {
  return (
      <Router>
          <div className="App">
              <Header />
              <Routes>
                  {/*<Route path="/">*/}
                  {/*    <Header />*/}
                  {/*</Route>*/}
                  <Route path="/"  element={<Home />}/> {/*add element={<Home />} */}
                  {/*<Route path="/checkout" element={<Checkout />}/>*/}
              </Routes>
          </div>
      </Router>
  );
}

export default App;
